package com.jiw.ph.images;

import lombok.extern.slf4j.Slf4j;
import net.coobird.thumbnailator.Thumbnails;
import org.apache.commons.codec.binary.Base64;
import sun.misc.BASE64Decoder;

import javax.imageio.ImageIO;
import java.awt.image.BufferedImage;
import java.io.*;

/**
 * @Description 将较大的Base64 图片，压缩成较小的Base64 图片，直接输出Base64 ，中间不用生成图片转换
 * @Author pangh
 * @Date 2020年06月27日
 * @Version v1.0.0
 */
@Slf4j
public class BigBase64Image2Small {

    private static String resizeImageToSmall(String base64Img) {

        try {
            // base64 还原成图片
            BufferedImage src = ImageIO.read(new ByteArrayInputStream(new BASE64Decoder().decodeBuffer(base64Img)));
            // 图片降低分辨率
            BufferedImage output = Thumbnails.of(src).size(src.getWidth() / 3, src.getHeight() / 3).asBufferedImage();
            // output 图片生成Base64
            String base64 = imageToBase64(output);
            if (base64.length() - base64.length() / 8 * 2 > 40000) {
                output = Thumbnails.of(output).scale(1 / (base64.length() / 40000)).asBufferedImage();
                base64 = imageToBase64(output);
            }
            return base64;
        } catch (Exception e) {
            return base64Img;
        }
    }


    /**
     * BufferedImage转换成base64，在这里需要设置图片格式，如下是jpg格式图片
     *
     * @param bufferedImage
     * @return
     */
    /**
     * BufferedImage转换成base64，在这里需要设置图片格式，如下是jpg格式图片
     *
     * @param bufferedImage
     * @return
     */
    private static String imageToBase64(BufferedImage bufferedImage) throws IOException {
        ByteArrayOutputStream baos = new ByteArrayOutputStream();
        ImageIO.write(bufferedImage, "jpg", baos);
        return new String(new Base64().encode((baos.toByteArray())));
    }

    /**
     * 生成图片到文件系统
     *
     * @param base64Code 图片Base64
     * @param path 文件系统路径
     * @return
     */
    public static boolean generateImage(String base64Code, String path) {
        if (null == base64Code) {
            return false;
        }
        try {
            OutputStream out = new FileOutputStream(path);
            out.write(Base64.decodeBase64(base64Code));
            out.flush();
            out.close();
            return true;
        } catch (Exception e) {
            return false;
        }

    }


    public static void main(String[] args) {

        StringBuilder sb = new StringBuilder();
        sb.append("");

        String s = resizeImageToSmall(sb.toString());

        if (generateImage(s, "/Users/pangh/Documents/1.jpg")){
            log.info("图片生成成功");
        }else{
            log.info("图片生成失败");
        }

    }

}